import "./daw.css"
export const SongEditor = (props) => {
  if(props.current){
    let tracks = props.current.data
    return <div className="grid-container"><TrackSelector tracks={tracks} /></div>
  } else {
    return "no parents"
  }
}

const TrackSelector = (props) => {
  let tracks = props.tracks.map(item => {
    return `${item.notes.length} | `//.notes.length
  })

  return tracks
}
